            }

            </div>

                <div id="countdown" style="font-weight: bold;">00d 00h 00m 00s</div>
            </div>
            
            <button class="btn btn-danger" onclick="logout()" style="padding: 10px 15px; background: #e74c3c; color: white; border: none; border-radius: 5px; cursor: pointer; font-weight: bold;">Logout</button>
        </div>
    </div>

    <script>
        // User Panel Functionality
        const accessKey = localStorage.getItem('accessKey');
        const expiresAt = localStorage.getItem('expiresAt');

        if (!accessKey || !expiresAt) {
            window.location.href = "user_login.html";
        }

        document.getElementById('displayKey').textContent = accessKey;
        document.getElementById('displayExpiry').textContent = new Date(parseInt(expiresAt)).toLocaleString();

        function updateCountdown() {
            const now = Date.now();
            const remaining = parseInt(expiresAt) - now;
            
            if (remaining <= 0) {
                document.getElementById('countdown').textContent = "EXPIRED";
                logout();
                return;
            }
            
            const days = Math.floor(remaining / (1000 * 60 * 60 * 24));
            const hours = Math.floor((remaining % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
            const mins = Math.floor((remaining % (1000 * 60 * 60)) / (1000 * 60));
            const secs = Math.floor((remaining % (1000 * 60)) / 1000);
            
            document.getElementById('countdown').textContent = 
                `${days}d ${hours}h ${mins}m ${secs}s`;
        }

        function logout() {
            localStorage.removeItem('userLoggedIn');
            localStorage.removeItem('accessKey');
            localStorage.removeItem('expiresAt');
            window.location.href = "user_login.html";
        }

        setInterval(updateCountdown, 1000);
        updateCountdown();
    </script>
